INSERT INTO `wikis` VALUES ('Minecraft','<p>Minecraft 是一款备受喜爱的沙盒游戏，由瑞典开发者 Markus Persson 创作并由 Mojang Studios 发行。这款游戏以其简约而富有创造性的玩法而闻名于世。</p><p>Minecraft 的世界由各种各样的方块构成，您可以在这个虚拟世界中探索、建造、挖掘和冒险。您可以建造属于自己的房屋、城市甚至整个王国。利用各种资源，制作工具和武器，与敌对生物战斗或与朋友合作，在这个无限创意的世界中畅享乐趣。</p><p>Minecraft 提供了多种游戏模式，以满足不同的游戏需求。创造模式让您拥有无限资源和飞行能力，可以尽情发挥创意，打造惊人的建筑作品。生存模式则考验您的采集、制作和求生能力，您需要收集食物、建造庇护所，并与怪物战斗。</p><p>Minecraft 还有冒险模式、探索模式等供您选择。此外，游戏还支持多人联机，与好友一起探险、合作或竞争。</p><p>Minecraft 独特的像素风格和简约的游戏机制使其成为全球各年龄段玩家的喜爱之选。这个游戏不仅激发了玩家的创造力和想象力，还培养了解决问题的能力、团队合作和社交交流的技巧。</p><p>无论您是喜欢建造、探索还是挑战自己的游戏玩家，Minecraft 都将带给您一个无限可能的方块世界。快来加入我们，开始您的冒险之旅吧！</p>','mc'),('我的世界基岩版 Bedrock Edition','<p><a href=\"minecraft:?addExternalServer=Axolotland-BEserver|mcax.cn:19132\" target=\"_blank\"><span style=\"color: rgb(66, 144, 247);\"><strong>进入服务器</strong></span></a></p><ul><li><a href=\"http://mcax.cn:5/index.php/%E6%88%91%E7%9A%84%E4%B8%96%E7%95%8C%E5%9F%BA%E5%B2%A9%E7%89%88%E4%B8%8B%E8%BD%BD%E6%B8%B8%E6%88%8F/%E6%B3%A8%E5%86%8C%E8%B4%A6%E5%8F%B7/%E8%BF%9B%E6%9C%8D%E5%8A%A1%E5%99%A8%E6%95%99%E7%A8%8B\" target=\"_blank\">怎么下载游戏/注册账号/进服务器？</a></li><li><a href=\"http://mcax.cn:5/index.php/%E6%88%91%E7%9A%84%E4%B8%96%E7%95%8C%E5%9F%BA%E5%B2%A9%E7%89%88%E6%9C%8D%E5%8A%A1%E5%99%A8%E8%BF%9B%E4%B8%8D%E5%8E%BB%E8%A7%A3%E5%86%B3%E5%8A%9E%E6%B3%95\" target=\"_blank\">进不去怎么办？</a></li><li><a href=\"http://mcax.cn:5/index.php/%E6%88%91%E7%9A%84%E4%B8%96%E7%95%8C%E5%9F%BA%E5%B2%A9%E7%89%88%E6%8C%87%E4%BB%A4%E6%95%99%E7%A8%8B\" target=\"_blank\">有哪些指令/有哪些插件？</a></li><li><a href=\"http://mcax.cn:5/index.php/%E6%88%91%E7%9A%84%E4%B8%96%E7%95%8C%E5%9F%BA%E5%B2%A9%E7%89%88%E8%A2%AB%E7%86%8A%E6%80%8E%E4%B9%88%E5%8A%9E\" target=\"_blank\">被熊怎么办？</a></li><li><a href=\"http://mcax.cn:5/index.php/%E6%88%91%E7%9A%84%E4%B8%96%E7%95%8C%E5%9F%BA%E5%B2%A9%E7%89%88%E6%9C%8D%E5%8A%A1%E5%99%A8%E8%A7%84%E5%88%99\" target=\"_blank\">有哪些规则/特色/玩法？</a></li><li><a href=\"http://mcax.cn:5/index.php/%E6%88%91%E7%9A%84%E4%B8%96%E7%95%8C%E5%9F%BA%E5%B2%A9%E7%89%88%E7%94%